    false,nt"url": null,nt"notes": "Benthic habitat maps of the nearshore marine
    environment of Vieques, Puerto Rico were created by visual interpretation of remotely
    sensed imagery. The objective of this effort, conducted by NOAA's Center for Coastal
    Monitoring and Assessment - Biogeography Branch in partnership with NOAA's Offic
    of Response and Restoration, was to provide spatially-explicit information on the
    habitat types, biological cover and live coral cover of Vieques' coral reef ecosystem.
    One-meter panchromatic and four-meter multi-spectral data from the IKONOS satellite
    sensor were purchased for the mapping area. Photo-interpreters accurately and reliably
    delineated boundaries of features from this IKONOS imagery as they appeared on the
    computer monitor using a software interface.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
